rulesList.cssText:
@-webkit-keyframes txp_overlay_play { 
  0% { transform: scale(0.5); opacity: 1; }
  100% { transform: scale(1); opacity: 0; }
}

@keyframes txp_overlay_play { 
  0% { transform: scale(0.5); opacity: 1; }
  100% { transform: scale(1); opacity: 0; }
}

@-webkit-keyframes txp_icon_scale { 
  0% { transform: scale(1); transform-origin: center center; }
  50% { transform: scale(1.2); transform-origin: center center; }
  100% { transform: scale(1); transform-origin: center center; }
}

@keyframes txp_icon_scale { 
  0% { transform: scale(1); transform-origin: center center; }
  50% { transform: scale(1.2); transform-origin: center center; }
  100% { transform: scale(1); transform-origin: center center; }
}

@supports ((-webkit-backdrop-filter:blur(10px)) or (backdrop-filter:blur(10px))) {
  .txp_full_screen_pause-active-mask { display: block; }
  .txp_full_screen_pause-active-mask-inner { backdrop-filter: blur(35px); background: rgba(0, 0, 0, 0.4); }
}
